import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
function App() {
  return (
    <Route>
      <Switch>
        {/* <Route path="/" exact component={Login}/> */}
        <Route path="/signup" exact component={Signup}/>
        <Route path="/login" exact component={Login}/>
      </Switch>
    </Route>
  );
}

export default App;
